import React from "react";
import Common from "./Common";
import Img_3 from "./img-3.svg";

const Home = () => {
  return (
    <>
      <Common
        name="Welcome to Home Page"
        imgSrc={Img_3}
        visit="/service"
        btnName="Get Started"
      />
    </>
  );
};

export default Home;
